import styled from 'styled-components';

import FileUploadIcon from '../../../assets/icons/file_upload.svg';

const StyledFileUploadForm = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100%;
`;

const StyledFileUploadFormContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  height: 90%;
  width: 80%;
  box-shadow: 1px 1px 5px 0px rgba(209, 186, 209, 1);
  justify-content: center;
  background-color: #fef5fd;
  img {
    width: 100px;
  }
`;

const FileuploadForm = () => (
  <StyledFileUploadForm>
    <StyledFileUploadFormContainer>
      <img src={FileUploadIcon} alt="file upload icon" />
      <h3> Upload your files </h3>
      <p> Drop your files here or browse. </p>
    </StyledFileUploadFormContainer>
  </StyledFileUploadForm>
);

export default FileuploadForm;
